// building_info/buildingCollection.js
const buildingCollection = {
  type: "FeatureCollection",
  features: [
    {
      type: "Feature",
      properties: {},
      geometry: {
        type: "Polygon",
        coordinates: [
          [
            [126.932602, 37.576964],
            [126.932602, 37.591791],
            [126.956806, 37.591791],
            [126.956806, 37.576964],
            [126.932602, 37.576964],
          ],
        ],
      },
    },
  ],
};

export default buildingCollection;
